import React from 'react';
import logo from './logo.svg';
import './App.css';
import HomePage from './components/pages/Homepage.jsx';

class App extends Component {
	render() {
		return (
			<BrowserRouter>
				<div>
					<NavBar />
					<Switch>
						<Route exact path="/" component={HomePage} />
					</Switch>
				</div>
			</BrowserRouter>
		);
	}
}

export default App;
